import React from 'react';
import offer from '.images/offes.png';
import './App.css';

class App extends React.Component {
  render() {
     return (
        <div>
           <header>
            <nav class="">
                <ul>
                    <li><a class="active" href="#">Home</a></li>
                    <li><a href="contact.html">Contact</a></li>
                    <li><a class="float-right" href="profile.html">Profile</a></li>
                    <li><a class="float-right" href="signin.html">Login</a></li>
                  </ul>
            </nav>
          </header>

          <main>
            <div className="container">
              <div class="container">
                <h1 style="font-size:48px; text-align:center;">Ride My Ride</h1>
              </div>
                <h2 className="head">Ride offers</h2>
                <img src={offer} alt="offers" />
              </div>
          </main>
        </div>
     );
  }
}

export default App;
